export function updateRequest({
  id,
  name,
  street,
  number,
  complement,
  city,
  state,
  zip,
}) {
  return {
    type: '@recipient/UPDATE_REQUEST',
    id,
    name,
    street,
    number,
    complement,
    city,
    state,
    zip,
  };
}
